import './App.css';

function App() {
  const [initialData, setInitialData] = useState([{}])

  useEffect(() => {
    fetch('/api').then(
      response => response.json()
    ).then(data => console.log(data))
  });
  return (
    <div className="App">
      <h1></h1>
    </div>
  );
}

export default App;
